import './style.css'
import React from 'react';
import { FaBeer } from 'react-icons/fa';

export function Sidebar() {

    return(
        <div className="sidebar">
            <a href="#" class="active">Home</a>
            <a href="#">Link 1</a>
            <a href="#">Link 2</a>
            <a href="#">Link 3</a>
            <a href="#">Link 4</a>
        </div>
    )

}
